0006150666_hpitpi.jpg\",\"https://res.cloudinary.com/dyscykxye/image/upload/v1735682435/LD0006150667_kpc9t3.jpg\"]}', '40', '8', 'true', '2024-12-31 15:10:29.339', '2024-12-31 22:00:41.782', '36420c92-138f-455d-9b05-887181a7b793'), ('03ee99f6-b69c-4ec5-8bf7-188903def7af', 'Corsair Vengeance RGB PRO SL Series', 'Corsair's high-end Vengeance RGB PRO SL Series PC memory offers performance and stability for your PC with strong overclocking potential thanks to hand-picked memory chips. They also give you multi-zone RGB lighting controlled by Corsair iCUE software.', '159.99', '95.994', 'gskill-flare-x-3200', '"{\"https://res.cloudinary.com/dyscykxye/image/upload/v1735682644/ram-02_ijljav.webp\",\"https://res.cloudinary.com/dyscykxye/image/upload/v1735682645/ram-03_jchzph.webp\",\"https://res.cloudinary.com/dyscykxye/image/upload/v1735682646/ram-01_lxg7bv.webp\"]}', '44', '9', 'true', '2024-12-31 15:10:29.339', '2024-12-31 22:04:08.912', 'dc0882f8-9927-4a49-9315-79e2acbc80b3'), ('05bfcd67-1f84-4c6e-bf5f-cef64ca0a2dc', 'Elgato Wave 3', 'Premium USB condenser microphone designed specifically for content creators. Features proprietary Clipguard technology that prevents audio distortion. Multi-function dial provides easy control over input gain, monitoring volume, and crossfade. 96kHz / 24-bit analog to digital converter ensures pristine audio quality. Tight cardioid polar pattern minimizes room noise. Includes Wave Link software for advanced audio mixing and routing. Sleek design with capacitive mute touch sensor.', '159.99', '135.9915', 'elgato-wave-3', '"{\"https://res.cloudinary.com/dyscykxye/image/upload/v1735864127/elgato_wave3_cardioid_condenser_usb_microphone_ac36029_xukgu8.jpg\",\"https://res.cloudinary.com/dyscykxye/image/upload/v1735864128/elgato_wave3_cardioid_condenser_usb_microphone_ac36029_7_rb4haq.jpg\",\"https://res.cloudinary.com/dyscykxye/image/upload/v1735864128/elgato_wave3_cardioid_condenser_usb_microphone_ac36029_4_lrxhly.jpg\",\"https://res.cloudinary.