DSP with filter and compressor presets. Built-in headphone amplifier with zero-latency monitoring. Includes desktop stand and USB-C cable. Smart knob control for gain, headphone level, and mix blend. Compatible with major streaming and recording platforms.', '179.99', null, 'mackie-carbon', '"{\"https://res.cloudinary.com/dyscykxye/image/upload/v1735681289/th_20_eerpmp.jpg\",\"https://res.cloudinary.com/dyscykxye/image/upload/v1735681290/th_21_tfjiiv.jpg\",\"https://res.cloudinary.com/dyscykxye/image/upload/v1735681290/th_22_fwyxfn.jpg\",\"https://res.cloudinary.com/dyscykxye/image/upload/v1735681291/th_23_gv2tnc.jpg\"]}', '35', '35', 'true', '2024-12-31 15:10:29.339', '2024-12-31 21:41:33.829', 'bb686c86-adbe-40e3-9475-fc2a0d363037'), ('0c1e990b-ad0b-4dc5-9ed4-ebdb0d70ce6d', 'Corsair K70 RGB PRO', 'Full-size mechanical gaming keyboard with Cherry MX Speed Silver switches. Features AXON hyper-processing technology, tournament switch, and per-key RGB backlighting. Includes detachable USB-C cable, magnetic palm rest, and dedicated media controls. Aircraft-grade aluminum frame and iCUE software integration.', '169.99', null, 'corsair-k70-rgb-pro', '"{\"https://res.cloudinary.com/dyscykxye/image/upload/v1735685304/LD0005918755_1_qvpuhz.jpg\",\"https://res.cloudinary.com/dyscykxye/image/upload/v1735685311/LD0005918756_1_g8xydn.jpg\",\"https://res.cloudinary.com/dyscykxye/image/upload/v1735685310/LD0005918758_1_fipemg.jpg\",\"https://res.cloudinary.com/dyscykxye/image/upload/v1735685315/LD0005918757_1_fcx8kn.jpg\"]}', '50', '50', 'true', '2024-12-31 15:10:29.339', '2025-01-03 00:20:53.404', 'ad4d4061-06dd-4abd-bdb4-de910ef57059'), ('0c9719e7-732d-4106-a906-d2721acf6e25', 'XPG Core Reactor 850W', 'High-performance 850W power supply with 80 PLUS Gold certification and fully modular design. Features Japanese capacitors, DC-to-DC conversion, and tight voltage regulation. Includes hybrid fan control, premium flat cables, and full protection suite. 120mm fluid dynamic bearing fan for quiet operation. 10-year warranty and extensive testing for reliability.', '149.99', '119.992', 'xpg-core-reactor-850', '"{\"https://res.cloudinary.com/dyscykxye/image/upload/v1735681904/th_24_ej6blb.jpg\",\"https://res.cloudinary.com/dyscykxye/image/upload/v1735681904/t%C3%A9l%C3%A9chargement_12_lracb2.jpg\",\"https://res.cloudinary.com/dyscykxye/image/upload/v1735681904/th_25_vg8wxo.jpg\",\"https://res.cloudinary.com/dyscykxye/image/upload/v1735681905/th_26_ibgoaj.jpg\"]}', '40', '40', 'true', '2024-12-31 15:10:29.339', '2024-12-31 21:51:47.981', '87429a7b-b1cb-406b-af3f-b3487866bc7a'), ('0dd2aa5b-7de7-4fdc-bcf1-a0ef2c587135', 'AMD Ryzen 9 7950X3D', 'Flagship AM5 processor featuring revolutionary 3D V-Cache technology. 16 cores, 32 threads with up to 5.7GHz boost clock. Features 144MB total cache (128MB L3 + 16MB L2), PCIe 5.0 support, and DDR5 memory compatibility. Built on TSMC 5nm process. Integrated Radeon graphics with 2 compute units. 120W base TDP with AMD PBO and Curve Optimizer support. Ideal for gaming and content creation with class-leading gaming performance and exceptional multi-threaded capabilities.', '699.99', null, 'amd-7950x3d', '"{\"https://res.cloudinary.com/dyscykxye/image/upload/v1735683392/LD0006014130_0006016756_p2ikfz.jpg\",\"https://res.cloudinary.com/dyscykxye/image/upload/v1735683398/LD0006014133_0006016759_popdd5.jpg\",\"https://res.cloudinary.com/dyscykxye/image/upload/v1735683402/LD0006014132_0006016758_oqnfi2.jpg\",\"https://res.cloudinary.com/dyscykxye/image/upload/v1735683401/LD0006014131_0006016757_k5j7bo.jpg\"]}', '25', '5', 'true', '2024-12-31 15:10:29.339', '2024-12-31 22:16:45.606', '1dde3d5c-1bd6-4976-bfec-2115feb47317'), ('0f674f45-1c77-46e5-98a6-b5a8c35c9372', 'HyperX QuadCast™ Standalone', 'RGB USB condenser gaming microphone with tap-to-mute sensor and dynamic lighting effects. Features four selectable polar patterns: stereo, omnidirectional, cardioid, and bidirectional. Anti-vibration shock mount and built-in pop